import React from "react";
import { Box } from "@material-ui/core";

function DashboardIcon() {
    return (
        <Box>
        sx={{
            height: '50px',
            width: '50px',
            padding: '10px',

        }}
            <Box 
            sx={{
                height: '25px',
                width: '25px'
            }}
            component='img'
            src='/vectors/grid.png'
            alt='dashboard_logo'
            />
            <p>Dashboard</p>
        </Box>

    )
}

export default DashboardIcon;
